B.Bw=new A.iw("Cisco Networking Academy","2021-2022","In Cisco I learned how to design, build, and maintain computer networks, as well as how to troubleshoot common network issues. Additionally, I gained a strong understanding of network security and how to implement security measures to protect against cyber threats. \nThrough hands-on labs and simulations, utilizing tools such as Packet Tracer, I developed practical experience working with Cisco networking equipment and became proficient in using networking protocols and technologies such as TCP/IP, VLANs, and routing protocols.\n",250,null)
B.Bu=new A.iw("High School: Computer Science 98/100","2017-2022","During my studies in high school, I learned the basics of software/web development, database management, and network systems.\nI finished school with a knowledge of programming (C++, Java, CSS, HTML, JavaScript, Arduino, Assembly, MySQL), computer programs (Oracle, XAMPP, DEVC++, NetBeans, MySQL Workbench) and project management (Waterfall).\n",250,null)
